import React from "react";
import Form from 'react-bootstrap/Form';

export default function TestComponent() {

    return (
        <>
            <span className="h1">This is a test component!</span>
            
            <br />
            <br />
            <br />

            <Form.Group style={{ height: "500px" }} className="m-5" controlId="exampleForm.ControlTextarea1">
                <Form.Label>Enter options to clear:</Form.Label>
                <Form.Control as="textarea" rows={3} />
            </Form.Group>
        </>
    )
}
